package srv.converse.model;import java.util.Date;public class Report extends BaseEntity {    private String note;    private String reportType;    private Long userId;    private Date updatedAt;    private Participant participant;    public String getNote() {        return note;    }    public void setNote(String note) {        this.note = note;    }    public String getReportType() {        return reportType;    }    public void setReportType(String reportType) {        this.reportType = reportType;    }    public Long getUserId() {        return userId;    }    public void setUserId(Long userId) {        this.userId = userId;    }    public Date getUpdatedAt() {        return updatedAt;    }    public void setUpdatedAt(Date updatedAt) {        this.updatedAt = updatedAt;    }    public Participant getParticipant() {        return participant;    }    public void setParticipant(Participant participant) {        this.participant = participant;    }}